import React from 'react';

const Header = () => {
  return (
    <div className="bg-white p-4 border-b-4 border-blue-600 flex justify-between items-center">
      <h1 className="text-blue-600 font-extrabold text-xl">Header</h1>
      <button className="bg-blue-600 text-white font-semibold px-4 py-2 rounded-md hover:bg-blue-700">
        Sign In
      </button>
    </div>
  );
};

export default Header;
